Lego DREAMZzz Zoey ve Kedi-Baykuş Zian 71476
LEGO® DREAMZzz™ Zoey ve Kedi-Baykuş Zian (71476) yapım setiyle hayal güçlerinin önünü açın. Heyecan verici TV dizisinden esinlenen bu hayvan oyuncağıyla 9 yaş ve üzeri çocuklar, düş dünyasına yolculuk yaparak kahraman figürü Zoey’nin, Zian’ı kötü Gece Avcısı’ndan kurtarmasına yardım edebilir. Ayrıca çocuklar, bu setteki hikaye yönlendirmeli yapım talimatları ve 2 heyecan verici yapım moduyla kendilerini düş dünyası macerasına kaptırabilir ve iki kat daha uzun oyunlar oynayabilir. Zian’ı, kabuslardan uçarak kaçabilen bir Kedi-Baykuş olarak ya da onlarla savaşabilecek güzel kuyruklu bir Kedi-Tavus Kuşu olarak inşa ederken hayal güçleri uçuşa geçecek. Zoey, Cooper ve Gece Avcısı olmak üzere 3 minifigür, ayrıca Gece Avcısı’nın yardımcıları Sneak ve Snivel ile aksiyon hayat bulur. Zoey’nin ateş eden yayı ve Cooper’ın uçan motosikleti gibi aksesuarlarla bu fantastik oyuncak, çocukları en sevdikleri sahneleri canlandırmaya ve yenilerini hayal ederek saatlerce heyecan verici, hayali oyunlar oynamaya teşvik eder.;

Dönüşen hayvan oyuncağı – 9 yaş ve üzeri çocuklar, 2 heyecan verici yapım seçeneği sunan LEGO® DREAMZzz™ Zoey ve Kedi-Baykuş Zian yapım setiyle hayal güçlerini serbest bıraksın;
1 set, 2 model – Bu yaratıcı yapım oyuncağıyla çocuklar, Zian’ı kedi-baykuş veya kedi-tavus kuşu şeklinde yaparak kendi maceralarını seçebilir;
Zian ile oynayın – Hareketli başı, bacakları ve kuyruğuyla Zian figürü, çocukların yaratıcı oyunların keyfini çıkarmalarını kolaylaştırır;
Düşlerdeki oyuncak – LEGO® DREAMZzz™ TV dizisinden esinlenen bu küçük LEGO setiyle çocuklar, kendilerini en sevdikleri düş dünyası maceralarına kaptırabilir;
Çocuklar için hediye fikri – Genç düşçüler, çocuklara ödül olarak verilebilecek bu şahane oyuncak hediyesiyle saatlerce oynamanın keyfini çıkarabilir;
3 minifigür – LEGO® DREAMZzz™ kahramanları Zoey, Cooper ile kötü Gece Avcısı minifigürlerini, ayrıca Sneak ve Snivel figürlerini içerir;
Maceralarla dolu bir düş dünyası – Çocukların kendilerini aksiyona kaptırabilecekleri ve kahraman figürleriyle tanışabilecekleri LEGO® DREAMZzz™ serisindeki kız ve erkek çocuklara yönelik diğer harika oyuncakları (ayrı satılır) keşfedin;
Boyutlar – 437 parçalı set kedi-baykuş şeklinde inşa edildiğinde yüksekliği 20 cm, genişliği 21 cm, derinliği 20 cm’dir;

Lego Disney Sihirli Madrigal Evi 43245
İnşa edilebilen Sihirli Madrigal Evi (43245) oyuncağında 7 yaş ve üzeri hayranları ve çocukları, Enkanto filminden esinlenen sınırsız macera bekliyor. Filmden detaylarla dolu bu LEGO® ǀ Disney hediyesi fikri yapım seti, ailece birlikte inşa etmek için Madrigal ailesinin 9 bölümlü evini içerir. Hareket eden çatı kiremitleri, el sallayan panjurlar, salıncak yatak ve küçük saklama çekmecesi gibi fonksiyonlara sahiptir. Eğlenceli bir hediye fikri olan bu inşa edilebilen sette Mirabel, Abuela, Isabela, Dolores, Luisa ve Camilo LEGO ǀ Disney mini bebek figürleri, bir Antonio LEGO ǀ Disney mikro bebek figürü ve 2 LEGO ǀ Disney hayvan figürü bulunur. Çocuklar ve yetişkinler tüm farklı detayların keyfini çıkarabilir ve daha da fazla eğlence için ev, çocuklara yönelik diğer LEGO yapım setlerine ve serideki LEGO ǀ Disney yapım oyuncaklarına (ayrı satılır) eklenebilir. Çocuklar ayrıca LEGO Builder uygulamasıyla kolay ve sezgisel bir yapım deneyimi yaşar. Modelleri 3 boyutlu olarak yakınlaştırıp döndürebilir, setleri kaydedebilir ve ilerlemeyi takip edebilirler.;

Çocuklar için inşa edilebilen Enkanto oyuncağı – Sınırsız sihirli oyunlar için özellikler ve işlevlerle dolu, inşa edilebilen Sihirli Madrigal Evi oyun setini 7 yaş ve üzeri kız ve erkek çocuklara hediye edin;
Eğlenceli 8 oda – Bu LEGO® ǀ Disney yapım seti, birlikte inşa edilebilen 9 bölümlü renkli bir Madrigal evi modeli, ayrıca filmden esinlenen pek çok detay ve fonksiyon içerir;
Disney Enkanto karakterleri – 6 LEGO® ǀ Disney mini bebek figürü: Abuela, Mirabel, Isabela, Dolores, Luisa ve Camilo, bir Antonio LEGO ǀ Disney mikro bebek figürü ve 2 LEGO ǀ Disney hayvan figürü;
Yaratıcı LEGO® yapım seti – Çocuklar ayrı odaları oluşturduktan sonra birleştirerek Enkanto filminden sahneleri canlandırabilir ya da yaratıcı yeni hikayeler hayal edebilir;
7 yaş ve üzeri çocuklar için Disney hediyesi – Kız ve erkek çocuklarla film hayranları için eğlenceli bir hediye olacak, tanıdık karakterler, mekanlar ve aksesuarlar içeren bir yapım oyuncağı seti;
Yardımcı uygulama – Model severlerin modelleri 3 boyutlu olarak yakınlaştırabileceği ve döndürebileceği, ilerlemelerini takip edebileceği ve setlerini kaydedebileceği LEGO® Builder uygulamasındaki sezgisel talimatları keşfedin;
Yaşam becerilerini geliştirin – 7 LEGO® ǀ Disney film karakteri ve 2 LEGO ǀ Disney hayvan figürü, 8 oda ve oyunları teşvik eden parçalarla çocuklara yönelik bu yapım seti, eğlendirirken yaşam becerilerini geliştirmeye yardımcı olur;
Ölçüler – Bu 1560 parçalı Enkanto yapım oyuncağında yüksekliği 31 cm, genişliği 38 cm, derinliği 14 cm olan bir ev bulunur;

Connect3 Bebek Arabası Yan Bakım Çantası
&nbsp;
Bumprider Connect³ bebek arabanızın manyetik sistemine anında takılan yenilikçi Yan Bakım Çantası PU deriden ve yüksek kaliteli kumaşlardan üretilmiştir. Şık ve pratik çift taşıma sapları ve taşıma askısı ile kolayca taşınan ve tüm ihtiyaçlarınızı düzenleyip sığdırmak için çoklu bölmelere sahip olan bu geniş çanta ile konforlu gezilerin tadını çıkarın. &nbsp;
&nbsp;


Ürün&nbsp;Özellikleri:

Bumprider Connect³ bebek arabanıza manyetik sistemi ile saniyeler içinde takılır.
Çift tutma sapları ile elde veya taşıma askısı ile omuzda taşınabilir.&nbsp;
Ana bölmenin yanı sıra 6 adet ara cepler bulunur.
Çantanın kolay açılıp kapanması için manyetik kilit sistemi bulunur.
Takıldığında bebek arabasının dengesini artırır
Alt değiştirme minderi bebeğinizin bakımı sırasında en büyük yardımcınız olacaktır.
